import React from "react";
import "./Header.css";
import HeaderOptions from "./HeaderOptions/HeaderOptions";
import logo2 from "../../Assets/Images/logo2.jpg";
import WorkIcon from "@mui/icons-material/Work";
import ContactMailIcon from "@mui/icons-material/ContactMail";
import LibraryBooksIcon from "@mui/icons-material/LibraryBooks";
import InfoIcon from "@mui/icons-material/Info";
const Pageheader = (props) => {
  const handleAboutIcon = (sectionId) => {
    props.handleSectionClick(sectionId);
  };
  return (
    <>
      <nav className="header">
        <div className="header_left">
          <img
            src={logo2}
            style={{ height: "50px", borderRadius: "20px", marginLeft: "50px" }}
            alt="logo"
          />
        </div>

        <div className="header_right">
          <HeaderOptions
            Icon={InfoIcon}
            title="About"
            iconHandler={()=>handleAboutIcon("About")}
          />
          <HeaderOptions
            Icon={LibraryBooksIcon}
            title="Experience"
            iconHandler={()=>handleAboutIcon("Experience")}
          />
          <HeaderOptions
            Icon={WorkIcon}
            title="work"
            iconHandler={()=>handleAboutIcon("work")}
          />
          <HeaderOptions
            Icon={ContactMailIcon}
            title="Contact"
            iconHandler={()=>handleAboutIcon("Contact")}
          />
        </div>
      </nav>
    </>
  );
};

export default Pageheader;
